import {
    CalendarContainer,
    CalendarPageWrapper,
    CalendarTimeColumn,
    CalendarTimeText
} from "../styled/CalendarPages.styled";

function SetupTutorAvailability() {
    return (
        <CalendarPageWrapper>
            <CalendarContainer>
                <CalendarTimeColumn>
                    <CalendarTimeText>8h00</CalendarTimeText>
                </CalendarTimeColumn>
            </CalendarContainer>
        </CalendarPageWrapper>
    );
}

export default SetupTutorAvailability;
